const style = {
    ul: {
        listStyleType: "none",
        padding: 0,
        fontStyle: "italic"
    }
}

export default function TodoList(props) {
    return(
        <ul style={style.ul}>
            { props.todos.map(todo => {
                return <TodoItem />
            }) }
        </ul>
    )
}
